import React from "react";
import { authService } from "../firebase";

const Profile = ()=>{
  const onLogoutClick = ()=> authService.signOut();
  return(
    <>
    <h2>Profile Page</h2>
    <button onClick={onLogoutClick}>Log out</button>
    </>
  )

}

export default Profile;
